import React, { useEffect, useState } from "react";
import config from "../utils/config";
import "../styles/styles.css";

const AdminPanel = () => {
    const [movies, setMovies] = useState([]);
    const [series, setSeries] = useState([]);
    const [currentMoviePage, setCurrentMoviePage] = useState(1);
    const [currentSeriesPage, setCurrentSeriesPage] = useState(1);
    const [itemsPerPage, setItemsPerPage] = useState(10);
    const [searchQuery, setSearchQuery] = useState("");
    const [selectedItem, setSelectedItem] = useState(null);
    const [editData, setEditData] = useState({});
    const [error, setError] = useState("");

    useEffect(() => {
        const fetchData = async () => {
            const accessToken = sessionStorage.getItem("accessToken");

            if (!accessToken) {
                setError("❌ No hay token de autenticación. Inicia sesión nuevamente.");
                return;
            }

            try {
                const moviesResponse = await fetch(`${config.API_URL}/api/admin/movies`, {
                    method: "GET",
                    headers: { "Authorization": `Bearer ${accessToken}`, "Content-Type": "application/json" }
                });

                const seriesResponse = await fetch(`${config.API_URL}/api/admin/series`, {
                    method: "GET",
                    headers: { "Authorization": `Bearer ${accessToken}`, "Content-Type": "application/json" }
                });

                if (!moviesResponse.ok || !seriesResponse.ok) {
                    throw new Error("Error al obtener datos.");
                }

                setMovies(await moviesResponse.json());
                setSeries(await seriesResponse.json());
            } catch (error) {
                setError(error.message);
            }
        };

        fetchData();
    }, []);

    const handleEditClick = (item) => {
        setSelectedItem(item);
        setEditData({ ...item });
    };

    const handleDelete = async (id, type) => {
        const accessToken = sessionStorage.getItem("accessToken");

        if (!accessToken) {
            setError("❌ No hay token de autenticación.");
            return;
        }

        try {
            const response = await fetch(`${config.API_URL}/api/admin/${type}/${id}`, {
                method: "DELETE",
                headers: { "Authorization": `Bearer ${accessToken}`, "Content-Type": "application/json" }
            });

            if (!response.ok) {
                throw new Error("Error al eliminar.");
            }

            if (type === "movies") {
                setMovies(movies.filter(item => item.Id_Movie !== id));
            } else {
                setSeries(series.filter(item => item.Id_Series !== id));
            }
        } catch (error) {
            setError(error.message);
        }
    };

    const handlePageChange = (newPage, type) => {
        type === "movies" ? setCurrentMoviePage(newPage) : setCurrentSeriesPage(newPage);
    };

    const handleSearchChange = (e) => setSearchQuery(e.target.value.toLowerCase());

    const handleItemsPerPageChange = (e) => setItemsPerPage(Number(e.target.value));

    const filteredMovies = movies.filter(movie =>
        movie.Title.toLowerCase().includes(searchQuery)
    );

    const filteredSeries = series.filter(serie =>
        serie.Title.toLowerCase().includes(searchQuery)
    );

    const indexOfLastMovie = currentMoviePage * itemsPerPage;
    const indexOfFirstMovie = indexOfLastMovie - itemsPerPage;
    const currentMovies = filteredMovies.slice(indexOfFirstMovie, indexOfLastMovie);

    const indexOfLastSeries = currentSeriesPage * itemsPerPage;
    const indexOfFirstSeries = indexOfLastSeries - itemsPerPage;
    const currentSeries = filteredSeries.slice(indexOfFirstSeries, indexOfLastSeries);

    return (
        <div className="admin-container">
            <h1>Panel de Administración</h1>
            {error && <p className="error-message">{error}</p>}

            <input 
                type="text" 
                placeholder="Buscar título..." 
                onChange={handleSearchChange} 
                className="search-box"
            />

            {/* Tabla de Películas */}
            <h2>Películas</h2>
            <button className="add-btn">Añadir Película</button>
            <table className="users-table">
                <thead>
                    <tr>
                        <th>ID</th>
                        <th>Título</th>
                        <th>Género</th>
                        <th>Año</th>
                        <th>Duración</th>
                        <th>Idioma</th>
                        <th>Acciones</th>
                    </tr>
                </thead>
                <tbody>
                    {currentMovies.map(movie => (
                        <tr key={movie.Id_Movie}>
                            <td>{movie.Id_Movie}</td>
                            <td>{movie.Title}</td>
                            <td>{movie.Genre}</td>
                            <td>{movie.Release_Year}</td>
                            <td>{movie.Duration} min</td>
                            <td>{movie.Language}</td>
                            <td>
                                <button className="edit-btn" onClick={() => handleEditClick(movie)}>Modificar</button>
                                <button className="delete-btn" onClick={() => handleDelete(movie.Id_Movie, "movies")}>Eliminar</button>
                            </td>
                        </tr>
                    ))}
                </tbody>
            </table>

            {/* Tabla de Series */}
            <h2>Series</h2>
            <button className="add-btn">Añadir Serie</button>
            <table className="users-table">
                <thead>
                    <tr>
                        <th>ID</th>
                        <th>Título</th>
                        <th>Género</th>
                        <th>Año</th>
                        <th>Temporadas</th>
                        <th>Idioma</th>
                        <th>Acciones</th>
                    </tr>
                </thead>
                <tbody>
                    {currentSeries.map(serie => (
                        <tr key={serie.Id_Series}>
                            <td>{serie.Id_Series}</td>
                            <td>{serie.Title}</td>
                            <td>{serie.Genre}</td>
                            <td>{serie.Release_Year}</td>
                            <td>{serie.Seasons}</td>
                            <td>{serie.Language}</td>
                            <td>
                                <button className="edit-btn" onClick={() => handleEditClick(serie)}>Modificar</button>
                                <button className="delete-btn" onClick={() => handleDelete(serie.Id_Series, "series")}>Eliminar</button>
                            </td>
                        </tr>
                    ))}
                </tbody>
            </table>


            <br />
            <select onChange={handleItemsPerPageChange}>
                <option value="5">5 por página</option>
                <option value="10">10 por página</option>
                <option value="25">25 por página</option>
            </select>
        </div>
    );
};

export default AdminPanel;
